import React from 'react';
import {Pagination} from "react-bootstrap";
import "./PaginationStyle.css"


function Pages({curPage, totalCount}) {
    return (
        <div className={"pagination-container d-flex"}>
        <Pagination className={"pagination-cars"}>
            <Pagination.First />
            <Pagination.Prev />

            <Pagination.Item>{curPage - 1 === 0 ? "End" : curPage - 1}</Pagination.Item>
            <Pagination.Item>{curPage}</Pagination.Item>
            <Pagination.Item>{curPage + 1 === totalCount ? "" : curPage + 1}</Pagination.Item>

            <Pagination.Next />
            <Pagination.Last />
        </Pagination>
        </div>
    );
}

export default Pages;
